    <script>
      class Debugger {
        constructor(data) {
          this.data = data
          this.inst = 0
          this.breakpoints = new Set()

          this.lineOffsets = {}
          for (let sourceFile in data.sources) {
            let source = data.sources[sourceFile]
            if (source != null) {
              let lines = data.sources[sourceFile].split('\n')
              let offset = 0
              this.lineOffsets[sourceFile] = [0]
              for (let line of lines) {
                offset += line.length + 1
                this.lineOffsets[sourceFile].push(offset)
              }
            }
          }
        }

        next() {
          if (this.inst < this.data.trace.length - 1) {
            this.inst += 1
            return true
          } else return false
        }

        prev() {
          if (this.inst > 0) {
            this.inst -= 1
            return true
          } else return false
        }

        nextLine() {
          let startLineNo = this.lineNo()
          while (this.lineNo() == startLineNo || this.lineNo() == '::-1') {
            if (!this.next()) return false
          }
          return true
        }

        prevLine() {
          let startLineNo = this.lineNo()
          while (this.lineNo() == startLineNo || this.lineNo() == '::-1') {
            if (!this.prev()) return false
          }
          return true
        }

        nextBreakpoint() {
          while (this.nextLine() && !this.breakpointHit()) {}
          return this.breakpointHit()
        }

        prevBreakpoint() {
          while (this.prevLine() && !this.breakpointHit()) {}
          return this.breakpointHit()
        }

        addBreakpoint(file, line) {
          this.breakpoints.add(`${file}::${line}`)
        }

        removeBreakpoint(file, line) {
          this.breakpoints.delete(`${file}::${line}`)
        }

        isBreakpoint(file, line){
          return this.breakpoints.has(`${file}::${line}`)
        }

        currentInstInfo() {
          if (this._cachedInstNo !== this.inst) {
            let traceItem = this.data.trace[this.inst]
            let {infoHash, pc} = traceItem
            let contractInfo = this.data.contractInfoLookup[infoHash]
            let instInfo = contractInfo[pc]
            let [line, lineOffset] = this.byteOffsetToLineOffset(instInfo.sourceFile, instInfo.sourceStart)
            this._cachedInstInfo = {line, lineOffset, ...traceItem, ...instInfo}
            this._cachedInstNo = this.inst
          }
          return this._cachedInstInfo
        }

        byteOffsetToLineOffset(sourceFile, offset) {
          if (!(sourceFile in this.lineOffsets)) return [-1, -1]
          let fileOffsets = this.lineOffsets[sourceFile]
          // Switch to binary search if performance problematic
          for (let i = 0; i < fileOffsets.length - 1; i++) {
            if (fileOffsets[i] <= offset && offset < fileOffsets[i + 1]) return [i, offset - fileOffsets[i]]
          }
          return [-1, -1]
        }

        lineNo() {
          let {sourceFile, line} = this.currentInstInfo()
          return `${sourceFile}::${line}`
        }

        breakpointHit() {
          return this.breakpoints.has(this.lineNo())
        }
      }

      let DebugView = {
        currentTab: 'Bytecode',
        oninit(vnode) {
          this.debug = vnode.attrs['debugger']
        },
        onstep() {
          let currentFile = this.debug.currentInstInfo().sourceFile
          if (currentFile && this.currentTab != 'Bytecode') {
            this.currentTab = currentFile
          }
        },
        view(vnode) {
          return m('.container-fluid', [
            m('div', [
              m(
                'select.btn',
                {value: this.currentTab, onchange: (event) => this.currentTab = event.target.value},
                ['Bytecode'].concat(Object.keys(this.debug.data.sources)).map(
                  sourceFile => m('option', {value: sourceFile}, sourceFile)
                )
              ), ' ',
              m('button.btn.btn-info',
                {
                  onclick: () => {this.debug.prevBreakpoint(), this.onstep()},
                  accessKey: 'z'
                },
                "Prev Breakpoint"
              ), ' ',
              m('button.btn.btn-info',
                {
                  onclick: () => {this.debug.prevLine(), this.onstep()},
                  accessKey: 'x'
                },
                "Prev Line"
              ), ' ',
              m('button.btn.btn-info',

                  onclick: () => {this.debug.prev(), this.onstep()},
                  accessKey: 'c'
                },
                "Prev"
              ), ' ',
              m('button.btn.btn-primary',
                {
                  onclick: () => {this.debug.next(), this.onstep()},
                  accessKey: 'v'
                },
                "Next"
              ), ' ',
              m('button.btn.btn-primary',
                {
                  onclick: () => {this.debug.nextLine(), this.onstep()},
                  accessKey: 'b'
                },
                "Next Line"
              ), ' ',
              m('button.btn.btn-primary',
                {
                  onclick: () => {this.debug.nextBreakpoint(), this.onstep()},
                  accessKey: 'n'
                },
                "Next Breakpoint"
              )
            ]),
            m('.row', [
              m('.col-7', [
                (this.currentTab !== 'Bytecode')
                ? m(SourceCode, {'debugger': this.debug, sourceFile: this.currentTab})
                : m(ByteCode, {'debugger': this.debug})

              ]),
              m('.col-5', [
                m('h2', 'Stack'),
                m('ul',
                  this.debug.currentInstInfo().stack.map(
                    d => m('li', m('span.code-line', d))
                  )
                )
              ])
            ]),
            m('.row', [
              m('.col-6', [
                m('h2', 'Memory'),
                this.debug.currentInstInfo().memory.map(
                  (row, i) => m('.code-row', m('span.code-line', toPaddedHex(i * 32) + ' ' + row))
                )
              ]),
              m('.col-6', [
                m('h2', 'Storage'),
                function(storage) {
                  return Object.keys(storage).map(
                    key => m('.code-row', m('span.code-line', key + ' => ' + storage[key]))
                  )
                }(this.debug.currentInstInfo().storage)
              ])
            ])
          ])
        }
      }

      let SourceCode = {
        oninit(vnode) {
          this.debug = vnode.attrs['debugger']
        },

        view(vnode) {
          let instInfo = this.debug.currentInstInfo()
          let sourceFile = vnode.attrs.sourceFile
          let thisFile = sourceFile === instInfo.sourceFile
          if (thisFile) {
            var [startLine, startOffset] = this.debug.byteOffsetToLineOffset(
              sourceFile, instInfo.sourceStart
            )
            var [endLine, endOffset] = this.debug.byteOffsetToLineOffset(
              sourceFile, instInfo.sourceStart + instInfo.sourceLength
            )
          }
          const renderCodeLine = (line, i) => {
            let scrollAttrs = {
              oncreate: (vnode) => vnode.dom.scrollIntoView(),
              onupdate: (vnode) => vnode.dom.scrollIntoView()
            }
            if (!thisFile || i < startLine || endLine < i) {
              return m('span.code-line', line)
            } else if (startLine < i && i < endLine) {
              return m('span.code-line.current-line', line)
            } else if (startLine == i && i < endLine) {
              return [
                m('span.code-line', line.substring(0, startOffset)),
                m('span.code-line.current-line', scrollAttrs, line.substring(startOffset))
              ]
            } else if (startLine == i && i == endLine) {
              return [
                m('span.code-line', line.substring(0, startOffset)),
                m('span.code-line.current-line', scrollAttrs, line.substring(startOffset, endOffset)),
                m('span.code-line', line.substring(endOffset))
              ]
            } else if (startLine < i && i == endLine) {
              return [
                m('span.code-line.current-line', line.substring(0, endOffset)),
                m('span.code-line', line.substring(endOffset))
              ]
            } else throw new Error("Unexpected line start and end points")
          }
          return m('.code-container',
            (
              this.debug.data.sources[sourceFile] || '<source not available>'
            ).split('\n').map(
              (line, i) => m('.code-row', [
                m(
                  'span',
                  this.debug.isBreakpoint(sourceFile, i) ? {
                    class: 'code-label breakpoint',
                    onclick: () => this.debug.removeBreakpoint(sourceFile, i)
                  } : {
                    class: 'code-label',
                    onclick: () => this.debug.addBreakpoint(sourceFile, i)
                  },
                  (i + 1).toString()),
                renderCodeLine(line, i)
              ])
            )
          )
        }
      }

      let ByteCode = {
        oninit(vnode) {
          this.debug = vnode.attrs['debugger']
        },

        view(vnode) {
          let contractInfo = this.debug.data.contractInfoLookup[this.debug.currentInstInfo().infoHash]
          return m('.code-container',
            Object.keys(contractInfo).map(
              (pc) => m('.code-row', [
                m(
                  'span',
                  (this.debug.currentInstInfo().pc == pc)
                  ? {
                    class: 'current-line code-line',
                    oncreate: (vnode) => vnode.dom.scrollIntoView(),
                    onupdate: (vnode) => vnode.dom.scrollIntoView()
                  }
                  : {class: 'code-line', oncreate: () => vnode.dom.scrollIntoView()},
                  toPaddedHex(pc) + ' ' + contractInfo[pc].op
                )
              ])
            )
          )
        }
      }

      function toPaddedHex(n) {
        let hexified = parseInt(n).toString(16)
        let pad = "0000"
        return pad.substring(0, pad.length - hexified.length) + hexified
      }

  "sources": {
    "EtherLeverage.sol": "pragma solidity ^0.4.19;\n\nimport \"zeppelin-solidity/token/ERC20.sol\";\nimport \"zeppelin-solidity/math/SafeMath.sol\";\nimport \"zeppelin-solidity/ownership/Ownable.sol\";\nimport \"Exchange.sol\";\nimport \"HoldsBalances.sol\";\nimport \"TradingAccount.sol\";\n\ncontract EtherLeverage is HoldsBalances, Ownable {\n  using SafeMath for uint;\n\n  event TokensOffered(address lender, address token, uint tokenAmount, uint etherGuarantee, uint etherFee, uint expiresBlock);\n  event TokensLent(bytes32 offerHash, address lender, address token, uint tokenAmount, uint etherGuarantee, uint maturesBlock);\n  event TokensReturned(bytes);\n\n  struct LiquidityOffer {\n    address lender;\n    address token;\n    uint tokenAmount;\n    uint etherGuarantee;\n    uint etherFee;\n    uint expiresBlock;\n  }\n\n  struct _TradingAccountDetails {\n    address lender;\n    address token;\n    uint amount;\n    uint guarantee;\n    uint lenderFee;\n    uint ownerFee;\n    uint lenderEtherContribution;\n    uint expiresBlock;\n  }\n\n  mapping (bytes32 => bool) public liquidityOffers;\n  mapping (bytes32 => uint) public liquidityLentOut;\n  mapping (address => bytes32) public openPositions; // Maps trading account to the original offer hash\n\n  Exchange public exchange;\n  uint public feesPerEther = 100000000000000000;\n\n  function EtherLeverage(address _exchange) public {\n    exchange = Exchange(_exchange);\n  }\n\n  function setFees(uint newFees) public onlyOwner {\n    feesPerEther = newFees;\n  }\n\n  function offerTokensToBorrow(\n    address token,\n    uint tokenAmount,\n    uint etherGuarantee,\n    uint etherFee,\n    uint expiresBlock\n  ) public returns (bytes32) {\n    bytes32 hash = offerHash(LiquidityOffer(msg.sender, token, tokenAmount, etherGuarantee, etherFee, expiresBlock));\n    liquidityOffers[hash] = true;\n    TokensOffered(msg.sender, token, tokenAmount, etherGuarantee, etherFee, expiresBlock);\n    return hash;\n  }\n\n  function divRoundUp(uint n, uint d) private returns(uint) {\n    return n.add(d - 1) / d;\n  }\n\n  function borrowTokens(\n    address lender,\n    address token,\n    uint tokenAmount,\n    uint etherGuarantee,\n    uint etherFee,\n    uint expiresBlock,\n    uint amount,\n    uint lenderEtherContribution,\n    uint8 v, bytes32 r, bytes32 s\n  ) public returns (address) {\n    LiquidityOffer memory offerStruct = LiquidityOffer(lender, token, tokenAmount, etherGuarantee, etherFee, expiresBlock);\n    checkBorrowSignature(offerStruct, v, r, s);\n    return borrowTokensInternal(offerStruct, amount, lenderEtherContribution);\n  }\n\n  function checkBorrowSignature(\n    LiquidityOffer memory offer,\n    uint8 v, bytes32 r, bytes32 s\n  ) internal {\n    bytes32 hash = offerHash(offer);\n    require(liquidityOffers[hash] || ecrecover(keccak256(\"\\x19Ethereum Signed Message:\\n32\", hash), v, r, s) == offer.lender);\n\n  }\n\n  function borrowTokensInternal(\n    LiquidityOffer memory offer,\n    uint amount,\n    uint lenderEtherContribution\n  ) internal returns (address) {\n    bytes32 hash = offerHash(offer);\n\n    require(amount < offer.tokenAmount.sub(liquidityLentOut[hash]));\n    var (guarantee, lenderFee, ownerFee) = calculateBorrowingNumbers(offer, amount);\n\n    address newAccount = createTradingAccountForSender(_TradingAccountDetails(\n      offer.lender, offer.token, amount, guarantee, lenderFee, ownerFee, lenderEtherContribution, offer.expiresBlock\n    ));\n\n    liquidityLentOut[hash] = liquidityLentOut[hash].add(amount);\n    openPositions[newAccount] = hash;\n\n    TokensLent(hash, offer.lender, offer.token, amount, guarantee, offer.expiresBlock);\n\n    return newAccount;\n  }\n\n  function createTradingAccountForSender(\n    _TradingAccountDetails memory details\n  ) internal returns (address) {\n\n    tokens[0][msg.sender] = tokens[0][msg.sender].sub(details.lenderEtherContribution).sub(details.lenderFee).sub(details.ownerFee);\n    tokens[0][owner] = tokens[0][owner].add(details.ownerFee);\n    tokens[0][details.lender] = tokens[0][details.lender].add(details.lenderFee);\n    tokens[details.token][details.lender] = tokens[details.token][details.lender].sub(details.amount);\n\n    TradingAccountProxy newAccount = (new TradingAccountProxy).value(details.lenderEtherContribution)(\n      address(exchange), this, msg.sender, details.lender, details.token, details.amount, details.guarantee, details.expiresBlock\n    );\n    ERC20(details.token).transfer(address(newAccount), details.amount);\n    return address(newAccount);\n  }\n\n  function calculateBorrowingNumbers(LiquidityOffer memory offer, uint amount) internal returns (uint guarantee, uint lenderFee, uint ownerFee) {\n    guarantee = divRoundUp(offer.etherGuarantee.mul(amount), offer.tokenAmount);\n    lenderFee = divRoundUp(offer.etherFee.mul(amount), offer.tokenAmount);\n    ownerFee = lenderFee.mul(feesPerEther) / (1 ether);\n    return;\n  }\n\n  function returnLiquidity(uint tokensReturned) public {\n    /*\n     * Called by trading accounts to mark liquidity as returned. Should be harmless if\n     * called by attackers, since unrecognised senders will just add liquidity\n     * to the non-existent offer 0. Can't be called twice by trading account contracts,\n     * because it's called just before a selfdestruct.\n     */\n    bytes32 offerHash = openPositions[msg.sender];\n    require(offerHash != 0);\n    liquidityLentOut[offerHash] = liquidityLentOut[offerHash].sub(tokensReturned);\n    delete openPositions[msg.sender];\n  }\n\n  function cancelOffer(\n    address token,\n    uint tokenAmount,\n    uint etherGuarantee,\n    uint etherFee,\n    uint expiresBlock\n  ) public {\n    // Cancel offer by making all the liquidity look lent out\n    bytes32 hash = offerHash(LiquidityOffer(msg.sender, token, tokenAmount, etherGuarantee, etherFee, expiresBlock));\n    liquidityLentOut[hash] = liquidityLentOut[hash].add(tokenAmount);\n  }\n\n  function offerHash(LiquidityOffer memory offer) internal returns (bytes32) {\n    return keccak256(this, offer);\n  }\n}\n",
    "Exchange.sol": "// Public interface extracted from EtherDelta\n\npragma solidity 0.4.19;\n\ncontract Exchange {\n  uint public feeMake; //percentage times (1 ether)\n  uint public feeTake; //percentage times (1 ether)\n  mapping (address => mapping (address => uint)) public tokens; //mapping of token addresses to mapping of account balances (token=0 means Ether)\n  mapping (address => mapping (bytes32 => bool)) public orders; //mapping of user accounts to mapping of order hashes to booleans (true = submitted by user, equivalent to offchain signature)\n  mapping (address => mapping (bytes32 => uint)) public orderFills; //mapping of user accounts to mapping of order hashes to uints (amount of order that has been filled)\n\n\n  event Order(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user);\n  event Cancel(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s);\n  event Trade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, address get, address give);\n  event Deposit(address token, address user, uint amount, uint balance);\n  event Withdraw(address token, address user, uint amount, uint balance);\n\n  function deposit() payable public;\n  function withdraw(uint amount) public;\n  function depositToken(address token, uint amount) public;\n  function withdrawToken(address token, uint amount) public;\n  function balanceOf(address token, address user) constant public returns (uint);\n  function order(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce) public;\n  function trade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s, uint amount) public;\n  function testTrade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s, uint amount, address sender) constant public returns(bool);\n  function availableVolume(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s) constant public returns(uint);\n  function amountFilled(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s) constant public returns(uint);\n  function cancelOrder(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, uint8 v, bytes32 r, bytes32 s) public;\n}\n",
    "FaucetToken.sol": "pragma solidity ^0.4.19;\n\nimport \"zeppelin-solidity/token/StandardToken.sol\";\nimport \"zeppelin-solidity/token/DetailedERC20.sol\";\n\ncontract FaucetToken is StandardToken, DetailedERC20 {\n  function FaucetToken(string _name, string _symbol, uint8 _decimals) DetailedERC20(_name, _symbol, _decimals) {}\n\n  function gimme(uint256 _amount) public {\n    totalSupply = totalSupply.add(_amount);\n    balances[msg.sender] = balances[msg.sender].add(_amount);\n    Transfer(address(0), msg.sender, _amount);\n  }\n}\n",
    "HoldsBalances.sol": "pragma solidity ^0.4.19;\n\nimport \"zeppelin-solidity/token/ERC20.sol\";\nimport \"zeppelin-solidity/math/SafeMath.sol\";\n\ncontract HoldsBalances {\n  using SafeMath for uint256;\n  mapping (address => mapping (address => uint)) public tokens; //mapping of token addresses to mapping of account balances (token=0 means Ether)\n\n  event Deposit(address token, address from, address recipient, uint amount, uint balance);\n  event Withdraw(address token, address from, address to, uint amount, uint balance);\n\n  function deposit() payable public {\n    depositFor(msg.sender);\n  }\n\n  function depositFor(address recipient) payable public {\n    tokens[0][recipient] = tokens[0][recipient].add(msg.value);\n    Deposit(0, msg.sender, recipient, msg.value, tokens[0][recipient]);\n  }\n\n  function withdraw(uint amount) public {\n    withdrawTo(amount, msg.sender);\n  }\n\n  function withdrawTo(uint amount, address destination) public {\n    require(amount <= tokens[0][msg.sender]);\n    tokens[0][msg.sender] = tokens[0][msg.sender].sub(amount);\n    destination.transfer(amount);\n    Withdraw(0, msg.sender, destination, amount, tokens[0][msg.sender]);\n  }\n\n  function depositToken(address token, uint amount) public {\n    //remember to call ERC20(address).approve(this, amount) or this contract will not be able to do the transfer on your behalf.\n    depositTokenInternal(token, msg.sender, amount, msg.sender);\n  }\n\n  function depositTokenFor(address token, uint amount, address recipient) public {\n    //remember to call ERC20(address).approve(this, amount) or this contract will not be able to do the transfer on your behalf.\n    depositTokenInternal(token, msg.sender, amount, recipient);\n  }\n\n  function receiveApproval(address _from, uint256 _value, address _tokenContract, bytes) public {\n    depositTokenInternal(_tokenContract, _from, _value, _from);\n  }\n\n  function withdrawToken(address token, uint amount) public {\n    withdrawTokenInternal(token, msg.sender, amount, msg.sender);\n  }\n\n  function withdrawTokenTo(address token, uint amount, address destination) public {\n    withdrawTokenInternal(token, msg.sender, amount, destination);\n  }\n\n  function balanceOf(address token, address user) public constant returns (uint) {\n    return tokens[token][user];\n  }\n\n  // Internal methods\n  function depositTokenInternal(address token, address from, uint256 amount, address recipient) internal {\n    require(token != 0);\n    tokens[token][recipient] = tokens[token][recipient].add(amount);\n    require(ERC20(token).transferFrom(from, this, amount));\n    Deposit(token, from, recipient, amount, tokens[token][recipient]);\n  }\n\n  function withdrawTokenInternal(address token, address from, uint256 amount, address destination) internal {\n    require(token !=0 && amount <= tokens[token][from]);\n    tokens[token][from] = tokens[token][from].sub(amount);\n    require(ERC20(token).transfer(destination, amount));\n    Withdraw(token, from, destination, amount, tokens[token][from]);\n  }\n}\n",
    "TradingAccount.sol": "pragma solidity ^0.4.19;\n\nimport \"zeppelin-solidity/token/ERC20.sol\";\nimport \"zeppelin-solidity/math/SafeMath.sol\";\nimport \"Exchange.sol\";\nimport \"HoldsBalances.sol\";\nimport \"EtherLeverage.sol\";\n\n/*\n * A key concept to understanding these contracts is \"slack\". The goal of the\n * contract is to ensure that no matter what, the lender either gets their\n * tokens back, or gets back the compensation they agreed to, or gets some\n * combination of the two. We can write this constraint as:\n *\n *  tokenBalance    ethBalance\n * -------------- + ---------- >= 1\n *   minTokens       minEther\n *\n * Since Solidity doesn't have rational numbers, we rewrite this constraint in\n * purely multiplicative terms as:\n *\n *  tokenBalance * minEther + ethBalance * minTokens >= minEther * minTokens\n *\n * We'll call the quantity on the left \"slack\", and now our constraint becomes\n * that the contract must maintain a minimum amount of slack.\n *\n * If we only had to deal with instantaneous trades (filling an open order),\n * it would be sufficient to simply ensure that this constraint is always\n * met. However, we also need to be able to handle open orders. The way we\n * handle this is by keeping track of how much slack an order would consume if\n * filled, and when it expires, and reserving that much slack until that block.\n * We also allow users to cancel orders, releasing any slack they held.\n */\n\ncontract TradingAccountVars {\n  uint256 constant MAX_SLACK = (2 ** 216) - 1;\n  event MoveIntoExchange(uint amount, address token);\n  event Order(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce);\n  event Trade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint amount);\n  event Cancel(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce);\n  event Close(uint lenderTokens, uint lenderEth, uint traderTokens, uint traderEth);\n  struct SlackReservation {\n    /*\n     * Choose sizes to pack into one word - in the unlikely event that a big\n     * order overflows slack, it may need to be split into multiple orders\n     */\n    uint40 expires;\n    uint216 slack;\n  }\n  Exchange _exchange;\n  EtherLeverage _master;\n  address _trader;\n  address _lender;\n  ERC20 _token;\n  uint _minTokens;\n  uint _minEther;\n  uint _maturesBlock;\n  uint _reservedSlack;\n  SlackReservation[] _slackReservations;\n  mapping (bytes32 => bool) cancelledOrders;\n}\n\ncontract TradingAccountLibrary is TradingAccountVars {\n  using SafeMath for uint;\n\n  function exchange() public constant returns (Exchange) {return _exchange;}\n  function master() public constant returns (EtherLeverage) {return _master;}\n  function trader() public constant returns (address) {return _trader;}\n  function lender() public constant returns (address) {return _lender;}\n  function token() public constant returns (ERC20) {return _token;}\n  function minTokens() public constant returns (uint) {return _minTokens;}\n  function minEther() public constant returns (uint) {return _minEther;}\n  function maturesBlock() public constant returns (uint) {return _maturesBlock;}\n\n  function tokenBalance() public constant returns (uint) {\n    return _token.balanceOf(this) + _exchange.balanceOf(_token, this);\n  }\n\n  function ethBalance() public constant returns (uint) {\n    return this.balance + _exchange.balanceOf(0, this);\n  }\n\n  modifier traderOnly {\n    require(msg.sender == _trader && block.number <= _maturesBlock);\n    _;\n  }\n\n  function moveTokensIntoExchange(uint value) public traderOnly {\n    _token.approve(address(_exchange), value);\n    _exchange.depositToken(address(_token), value);\n    MoveIntoExchange(value, _token);\n  }\n\n  function moveEtherIntoExchange(uint value) public payable traderOnly {\n    // Can also be used to add more ether, if trader needs more liquidity\n    _exchange.deposit.value(value)();\n    MoveIntoExchange(value, 0);\n  }\n\n  function order(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce) public traderOnly {\n    // Since this is a contract, it's not possible to sign transactions for an off-chain order book, so all orders have to be on-chain.\n    require(expires > _maturesBlock);\n    reserveSlack(slackNeeded(tokenGet, amountGet, tokenGive, amountGive), expires);\n    _exchange.order(tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    Order(tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n  }\n\n  function spareSlack() public constant returns (uint) {\n    return\n      tokenBalance().mul(_minEther).add(ethBalance()).mul(_minTokens)\n      .sub(_minEther.mul(_minTokens))\n      .sub(_reservedSlack);\n  }\n\n  function reserveSlack(uint slack, uint expires) internal {\n    if (slack > 0) {\n      require(slack <= MAX_SLACK);\n      uint spare = spareSlack();\n      if (slack > spare) {\n        cleanupSlack();\n        spare = spareSlack();\n        require(slack <= spare);\n      }\n      _reservedSlack = _reservedSlack.add(slack);\n      _slackReservations.push(SlackReservation(uint40(expires), uint216(slack)));\n    }\n  }\n\n  function trade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s, uint amount) public traderOnly {\n    _exchange.trade(tokenGet, amountGet, tokenGive, amountGive, expires, nonce, user, v, r, s, amount);\n    // For trades, rather than try to simulate the trade, we execute it, and revert it if balance invariants aren't satisfied\n    require(slackInvariantSatisfied());\n    Trade(tokenGet, amountGet, tokenGive, amountGive, expires, nonce, user, amount);\n  }\n\n  function ensureSlackInvariant() internal {\n    if (!slackInvariantSatisfied()) {\n      cleanupSlack();\n      require(slackInvariantSatisfied());\n    }\n  }\n\n\n  function slackInvariantSatisfied() public constant returns (bool) {\n    return tokenBalance().mul(_minEther).add(ethBalance().mul(_minTokens)) >= _minEther.mul(_minTokens).add(_reservedSlack);\n  }\n\n  function cancelOrder(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce) public traderOnly {\n    // When cancelling orders, we check the order is real, and hasn't already been cancelled,\n    // and if so, release the slack tied up in it.\n    bytes32 orderHash = sha256(address(_exchange), tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    if (_exchange.orders(this, orderHash) && !cancelledOrders[orderHash]) {\n      cancelledOrders[orderHash] = true;\n      releaseSlack(slackNeeded(tokenGet, amountGet, tokenGive, amountGive), expires);\n    }\n    _exchange.cancelOrder(tokenGet, amountGet, tokenGive, amountGive, expires, nonce, 0, 0, 0);\n  }\n\n  function releaseSlack(uint slack, uint expires) internal {\n    uint i = 0;\n    uint l = _slackReservations.length;\n    for (i = 0; i < l; i++) {\n      SlackReservation storage reservation = _slackReservations[i];\n      if (reservation.expires == expires && reservation.slack == slack) {\n        _reservedSlack -= slack;\n        delete _slackReservations[i];\n        break;\n      }\n    }\n    assert(i < l);\n  }\n\n  function slackNeeded(address tokenGet, uint amountGet, address tokenGive, uint amountGive) public constant returns (uint) {\n    uint feeMake = amountGet.mul(_exchange.feeMake()) / (1 ether);\n    if (tokenGet == 0 && tokenGive == address(_token)) {\n      uint ethGain = amountGet.sub(feeMake);\n      uint ethGainSlack = ethGain * _minTokens;\n      uint tokenLoss = amountGive;\n      uint tokenLossSlack = tokenLoss * _minEther;\n      if (tokenLossSlack > ethGainSlack) return tokenLossSlack - ethGainSlack;\n    } else if (tokenGet == address(_token) && tokenGive == 0) {\n      uint tokenGain = amountGet.sub(feeMake);\n      uint tokenGainSlack = tokenGain * _minEther;\n      uint ethLoss = amountGive;\n      uint ethLossSlack = ethLoss * _minTokens;\n      if (ethLossSlack > tokenGainSlack) return ethLossSlack - tokenGainSlack;\n    } else {\n      revert();\n    }\n  }\n\n  function cleanupSlack() internal {\n    uint l = _slackReservations.length;\n    for (uint i = 0; i < l; i++) {\n      SlackReservation storage reservation = _slackReservations[i];\n      if (reservation.expires != 0 && reservation.expires < block.number) {\n        _reservedSlack -= uint(reservation.slack);\n        delete _slackReservations[i];\n      }\n    }\n  }\n\n  function closeAccount() public {\n    require(msg.sender == _trader || (msg.sender == _lender && block.number > _maturesBlock));\n    uint tokensInExchange = _exchange.balanceOf(address(_token), this);\n    uint etherInExchange = _exchange.balanceOf(0, this);\n    if (tokensInExchange > 0) {\n      _exchange.withdrawToken(_token, tokensInExchange);\n    }\n    if (etherInExchange > 0) {\n      _exchange.withdraw(etherInExchange);\n    }\n    uint tokens = _token.balanceOf(this);\n    if (tokens >= _minTokens) {\n      uint traderTokens = tokens.sub(_minTokens);\n      uint traderEth = this.balance;\n      _token.approve(_master, tokens);\n      _master.depositTokenFor(address(_token), _minTokens, _lender);\n      _master.depositTokenFor(address(_token), traderTokens, _trader);\n      _master.depositFor.value(traderEth)(_trader);\n      _master.returnLiquidity(_minTokens);\n      Close(_minTokens, 0, traderTokens, traderEth);\n      selfdestruct(_trader);\n    } else {\n      /*\n       * If trader hasn't managed to buy the lender's tokens back, lender gets\n       * trader's entire position as compensation\n       */\n       uint lenderEth = this.balance;\n      _token.approve(_master, tokens);\n      _master.depositTokenFor(address(_token), tokens, _lender);\n      _master.depositFor.value(lenderEth)(_lender);\n      _master.returnLiquidity(tokens);\n      Close(tokens, lenderEth, 0, 0);\n      selfdestruct(_lender);\n    }\n  }\n}\n\ncontract TradingAccountProxy is TradingAccountVars {\n  /*\n   * A stub proxy, that delegatecalls into a library containing the trading account\n   * code. Since a trading account has to be created for every position, this\n   * needs to be as cheap as possible, hence the stub + library pattern.\n   * Obviously this is a risky pattern (see Parity multisig), so must be\n   * reviewed very carefully.\n   *\n   * Both the library and the stub inherit a base class containing only\n   * data definitions, to ensure they are binary compatible.\n   *\n   * We sidestep Parity multisig's initWallet vulnerability by putting the\n   * constructor into the proxy - there's not much gas to be saved by moving it\n   * into the library, and it cuts off a big piece of surface area.\n   *\n   * To try to avoid the \"use library as contract\" vulnerability that caused\n   * the Parity multisig selfdestruct, we ensure that all state-mutating methods\n   * can only be called by the lender or trader, and that these are initialised\n   * to values without private keys.\n   */\n\n  // During deployment, replace this with library address\n  address constant delegate = 0xdED78BBd6f4041b84939a561444D332c8E5B411b;\n\n  function TradingAccountProxy(\n    address __exchange, address __master,\n    address __trader, address __lender,\n    address __token, uint __minTokens, uint __minEther,\n    uint __maturesBlock\n  ) public payable {\n    _exchange = Exchange(__exchange);\n    _master = EtherLeverage(__master);\n    _trader = __trader;\n    _lender = __lender;\n    _token = ERC20(__token);\n    _minTokens = __minTokens;\n    _minEther = __minEther;\n    _maturesBlock = __maturesBlock;\n  }\n\n  function () payable public {\n    address _delegate = delegate;\n    assembly {\n      let sz := calldatasize\n      let scratch := mload(0x40)\n      calldatacopy(scratch, 0, sz)\n      let success := delegatecall(gas, _delegate, scratch, sz, 0, 0)\n      let retSz := returndatasize\n      returndatacopy(scratch, 0, retSz)\n      switch success\n      case 0 {\n        revert(scratch, retSz)\n      }\n      default {\n        return(scratch, retSz)\n      }\n    }\n  }\n}\n",
    "etherdelta.sol": "pragma solidity ^0.4.9;\n\ncontract SafeMath {\n  function safeMul(uint a, uint b) internal returns (uint) {\n    uint c = a * b;\n    assert(a == 0 || c / a == b);\n    return c;\n  }\n\n  function safeSub(uint a, uint b) internal returns (uint) {\n    assert(b <= a);\n    return a - b;\n  }\n\n  function safeAdd(uint a, uint b) internal returns (uint) {\n    uint c = a + b;\n    assert(c>=a && c>=b);\n    return c;\n  }\n\n  function assert(bool assertion) internal {\n    if (!assertion) throw;\n  }\n}\n\ncontract Token {\n  /// @return total amount of tokens\n  function totalSupply() constant returns (uint256 supply) {}\n\n  /// @param _owner The address from which the balance will be retrieved\n  /// @return The balance\n  function balanceOf(address _owner) constant returns (uint256 balance) {}\n\n  /// @notice send `_value` token to `_to` from `msg.sender`\n  /// @param _to The address of the recipient\n  /// @param _value The amount of token to be transferred\n  /// @return Whether the transfer was successful or not\n  function transfer(address _to, uint256 _value) returns (bool success) {}\n\n  /// @notice send `_value` token to `_to` from `_from` on the condition it is approved by `_from`\n  /// @param _from The address of the sender\n  /// @param _to The address of the recipient\n  /// @param _value The amount of token to be transferred\n  /// @return Whether the transfer was successful or not\n  function transferFrom(address _from, address _to, uint256 _value) returns (bool success) {}\n\n  /// @notice `msg.sender` approves `_addr` to spend `_value` tokens\n  /// @param _spender The address of the account able to transfer the tokens\n  /// @param _value The amount of wei to be approved for transfer\n  /// @return Whether the approval was successful or not\n  function approve(address _spender, uint256 _value) returns (bool success) {}\n\n  /// @param _owner The address of the account owning tokens\n  /// @param _spender The address of the account able to transfer the tokens\n  /// @return Amount of remaining tokens allowed to spent\n  function allowance(address _owner, address _spender) constant returns (uint256 remaining) {}\n\n  event Transfer(address indexed _from, address indexed _to, uint256 _value);\n  event Approval(address indexed _owner, address indexed _spender, uint256 _value);\n\n  uint public decimals;\n  string public name;\n}\n\ncontract StandardToken is Token {\n\n  function transfer(address _to, uint256 _value) returns (bool success) {\n    //Default assumes totalSupply can't be over max (2^256 - 1).\n    //If your token leaves out totalSupply and can issue more tokens as time goes on, you need to check if it doesn't wrap.\n    //Replace the if with this one instead.\n    if (balances[msg.sender] >= _value && balances[_to] + _value > balances[_to]) {\n    //if (balances[msg.sender] >= _value && _value > 0) {\n      balances[msg.sender] -= _value;\n      balances[_to] += _value;\n      Transfer(msg.sender, _to, _value);\n      return true;\n    } else { return false; }\n  }\n\n  function transferFrom(address _from, address _to, uint256 _value) returns (bool success) {\n    //same as above. Replace this line with the following if you want to protect against wrapping uints.\n    if (balances[_from] >= _value && allowed[_from][msg.sender] >= _value && balances[_to] + _value > balances[_to]) {\n    //if (balances[_from] >= _value && allowed[_from][msg.sender] >= _value && _value > 0) {\n      balances[_to] += _value;\n      balances[_from] -= _value;\n      allowed[_from][msg.sender] -= _value;\n      Transfer(_from, _to, _value);\n      return true;\n    } else { return false; }\n  }\n\n  function balanceOf(address _owner) constant returns (uint256 balance) {\n    return balances[_owner];\n  }\n\n  function approve(address _spender, uint256 _value) returns (bool success) {\n    allowed[msg.sender][_spender] = _value;\n    Approval(msg.sender, _spender, _value);\n    return true;\n  }\n\n  function allowance(address _owner, address _spender) constant returns (uint256 remaining) {\n    return allowed[_owner][_spender];\n  }\n\n  mapping(address => uint256) balances;\n\n  mapping (address => mapping (address => uint256)) allowed;\n\n  uint256 public totalSupply;\n}\n\ncontract ReserveToken is StandardToken, SafeMath {\n  address public minter;\n  function ReserveToken() {\n    minter = msg.sender;\n  }\n  function create(address account, uint amount) {\n    if (msg.sender != minter) throw;\n    balances[account] = safeAdd(balances[account], amount);\n    totalSupply = safeAdd(totalSupply, amount);\n  }\n  function destroy(address account, uint amount) {\n    if (msg.sender != minter) throw;\n    if (balances[account] < amount) throw;\n    balances[account] = safeSub(balances[account], amount);\n    totalSupply = safeSub(totalSupply, amount);\n  }\n}\n\ncontract AccountLevels {\n  //given a user, returns an account level\n  //0 = regular user (pays take fee and make fee)\n  //1 = market maker silver (pays take fee, no make fee, gets rebate)\n  //2 = market maker gold (pays take fee, no make fee, gets entire counterparty's take fee as rebate)\n  function accountLevel(address user) constant returns(uint) {}\n}\n\ncontract AccountLevelsTest is AccountLevels {\n  mapping (address => uint) public accountLevels;\n\n  function setAccountLevel(address user, uint level) {\n    accountLevels[user] = level;\n  }\n\n  function accountLevel(address user) constant returns(uint) {\n    return accountLevels[user];\n  }\n}\n\ncontract EtherDelta is SafeMath {\n  address public admin; //the admin address\n  address public feeAccount; //the account that will receive fees\n  address public accountLevelsAddr; //the address of the AccountLevels contract\n  uint public feeMake; //percentage times (1 ether)\n  uint public feeTake; //percentage times (1 ether)\n  uint public feeRebate; //percentage times (1 ether)\n  mapping (address => mapping (address => uint)) public tokens; //mapping of token addresses to mapping of account balances (token=0 means Ether)\n  mapping (address => mapping (bytes32 => bool)) public orders; //mapping of user accounts to mapping of order hashes to booleans (true = submitted by user, equivalent to offchain signature)\n  mapping (address => mapping (bytes32 => uint)) public orderFills; //mapping of user accounts to mapping of order hashes to uints (amount of order that has been filled)\n\n  event Order(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user);\n  event Cancel(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s);\n  event Trade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, address get, address give);\n  event Deposit(address token, address user, uint amount, uint balance);\n  event Withdraw(address token, address user, uint amount, uint balance);\n\n  function EtherDelta(address admin_, address feeAccount_, address accountLevelsAddr_, uint feeMake_, uint feeTake_, uint feeRebate_) {\n    admin = admin_;\n    feeAccount = feeAccount_;\n    accountLevelsAddr = accountLevelsAddr_;\n    feeMake = feeMake_;\n    feeTake = feeTake_;\n    feeRebate = feeRebate_;\n  }\n\n  function() {\n    throw;\n  }\n\n  function changeAdmin(address admin_) {\n    if (msg.sender != admin) throw;\n    admin = admin_;\n  }\n\n  function changeAccountLevelsAddr(address accountLevelsAddr_) {\n    if (msg.sender != admin) throw;\n    accountLevelsAddr = accountLevelsAddr_;\n  }\n\n  function changeFeeAccount(address feeAccount_) {\n    if (msg.sender != admin) throw;\n    feeAccount = feeAccount_;\n  }\n\n  function changeFeeMake(uint feeMake_) {\n    if (msg.sender != admin) throw;\n    if (feeMake_ > feeMake) throw;\n    feeMake = feeMake_;\n  }\n\n  function changeFeeTake(uint feeTake_) {\n    if (msg.sender != admin) throw;\n    if (feeTake_ > feeTake || feeTake_ < feeRebate) throw;\n    feeTake = feeTake_;\n  }\n\n  function changeFeeRebate(uint feeRebate_) {\n    if (msg.sender != admin) throw;\n    if (feeRebate_ < feeRebate || feeRebate_ > feeTake) throw;\n    feeRebate = feeRebate_;\n  }\n\n  function deposit() payable {\n    tokens[0][msg.sender] = safeAdd(tokens[0][msg.sender], msg.value);\n    Deposit(0, msg.sender, msg.value, tokens[0][msg.sender]);\n  }\n\n  function withdraw(uint amount) {\n    if (tokens[0][msg.sender] < amount) throw;\n    tokens[0][msg.sender] = safeSub(tokens[0][msg.sender], amount);\n    if (!msg.sender.call.value(amount)()) throw;\n    Withdraw(0, msg.sender, amount, tokens[0][msg.sender]);\n  }\n\n  function depositToken(address token, uint amount) {\n    //remember to call Token(address).approve(this, amount) or this contract will not be able to do the transfer on your behalf.\n    if (token==0) throw;\n    if (!Token(token).transferFrom(msg.sender, this, amount)) throw;\n    tokens[token][msg.sender] = safeAdd(tokens[token][msg.sender], amount);\n    Deposit(token, msg.sender, amount, tokens[token][msg.sender]);\n  }\n\n  function withdrawToken(address token, uint amount) {\n    if (token==0) throw;\n    if (tokens[token][msg.sender] < amount) throw;\n    tokens[token][msg.sender] = safeSub(tokens[token][msg.sender], amount);\n    if (!Token(token).transfer(msg.sender, amount)) throw;\n    Withdraw(token, msg.sender, amount, tokens[token][msg.sender]);\n  }\n\n  function balanceOf(address token, address user) constant returns (uint) {\n    return tokens[token][user];\n  }\n\n  function order(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce) {\n    bytes32 hash = sha256(this, tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    orders[msg.sender][hash] = true;\n    Order(tokenGet, amountGet, tokenGive, amountGive, expires, nonce, msg.sender);\n  }\n\n  function trade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s, uint amount) {\n    //amount is in amountGet terms\n    bytes32 hash = sha256(this, tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    if (!(\n      (orders[user][hash] || ecrecover(sha3(\"\\x19Ethereum Signed Message:\\n32\", hash),v,r,s) == user) &&\n      block.number <= expires &&\n      safeAdd(orderFills[user][hash], amount) <= amountGet\n    )) throw;\n    tradeBalances(tokenGet, amountGet, tokenGive, amountGive, user, amount);\n    orderFills[user][hash] = safeAdd(orderFills[user][hash], amount);\n    Trade(tokenGet, amount, tokenGive, amountGive * amount / amountGet, user, msg.sender);\n  }\n\n  function tradeBalances(address tokenGet, uint amountGet, address tokenGive, uint amountGive, address user, uint amount) private {\n    uint feeMakeXfer = safeMul(amount, feeMake) / (1 ether);\n    uint feeTakeXfer = safeMul(amount, feeTake) / (1 ether);\n    uint feeRebateXfer = 0;\n    if (accountLevelsAddr != 0x0) {\n      uint accountLevel = AccountLevels(accountLevelsAddr).accountLevel(user);\n      if (accountLevel==1) feeRebateXfer = safeMul(amount, feeRebate) / (1 ether);\n      if (accountLevel==2) feeRebateXfer = feeTakeXfer;\n    }\n    tokens[tokenGet][msg.sender] = safeSub(tokens[tokenGet][msg.sender], safeAdd(amount, feeTakeXfer));\n    tokens[tokenGet][user] = safeAdd(tokens[tokenGet][user], safeSub(safeAdd(amount, feeRebateXfer), feeMakeXfer));\n    tokens[tokenGet][feeAccount] = safeAdd(tokens[tokenGet][feeAccount], safeSub(safeAdd(feeMakeXfer, feeTakeXfer), feeRebateXfer));\n    tokens[tokenGive][user] = safeSub(tokens[tokenGive][user], safeMul(amountGive, amount) / amountGet);\n    tokens[tokenGive][msg.sender] = safeAdd(tokens[tokenGive][msg.sender], safeMul(amountGive, amount) / amountGet);\n  }\n\n  function testTrade(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s, uint amount, address sender) constant returns(bool) {\n    if (!(\n      tokens[tokenGet][sender] >= amount &&\n      availableVolume(tokenGet, amountGet, tokenGive, amountGive, expires, nonce, user, v, r, s) >= amount\n    )) return false;\n    return true;\n  }\n\n  function availableVolume(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s) constant returns(uint) {\n    bytes32 hash = sha256(this, tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    if (!(\n      (orders[user][hash] || ecrecover(sha3(\"\\x19Ethereum Signed Message:\\n32\", hash),v,r,s) == user) &&\n      block.number <= expires\n    )) return 0;\n    uint available1 = safeSub(amountGet, orderFills[user][hash]);\n    uint available2 = safeMul(tokens[tokenGive][user], amountGet) / amountGive;\n    if (available1<available2) return available1;\n    return available2;\n  }\n\n  function amountFilled(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, address user, uint8 v, bytes32 r, bytes32 s) constant returns(uint) {\n    bytes32 hash = sha256(this, tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    return orderFills[user][hash];\n  }\n\n  function cancelOrder(address tokenGet, uint amountGet, address tokenGive, uint amountGive, uint expires, uint nonce, uint8 v, bytes32 r, bytes32 s) {\n    bytes32 hash = sha256(this, tokenGet, amountGet, tokenGive, amountGive, expires, nonce);\n    if (!(orders[msg.sender][hash] || ecrecover(sha3(\"\\x19Ethereum Signed Message:\\n32\", hash),v,r,s) == msg.sender)) throw;\n    orderFills[msg.sender][hash] = amountGet;\n    Cancel(tokenGet, amountGet, tokenGive, amountGive, expires, nonce, msg.sender, v, r, s);\n  }\n}\n",
    "zeppelin-solidity/math/SafeMath.sol": "pragma solidity ^0.4.18;\n\n\n/**\n * @title SafeMath\n * @dev Math operations with safety checks that throw on error\n */\nlibrary SafeMath {\n  function mul(uint256 a, uint256 b) internal pure returns (uint256) {\n    if (a == 0) {\n      return 0;\n    }\n    uint256 c = a * b;\n    assert(c / a == b);\n    return c;\n  }\n\n  function div(uint256 a, uint256 b) internal pure returns (uint256) {\n    // assert(b > 0); // Solidity automatically throws when dividing by 0\n    uint256 c = a / b;\n    // assert(a == b * c + a % b); // There is no case in which this doesn't hold\n    return c;\n  }\n\n  function sub(uint256 a, uint256 b) internal pure returns (uint256) {\n    assert(b <= a);\n    return a - b;\n  }\n\n  function add(uint256 a, uint256 b) internal pure returns (uint256) {\n    uint256 c = a + b;\n    assert(c >= a);\n    return c;\n  }\n}\n",
    "zeppelin-solidity/ownership/Ownable.sol": "pragma solidity ^0.4.18;\n\n\n/**\n * @title Ownable\n * @dev The Ownable contract has an owner address, and provides basic authorization control\n * functions, this simplifies the implementation of \"user permissions\".\n */\ncontract Ownable {\n  address public owner;\n\n\n  event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);\n\n\n  /**\n   * @dev The Ownable constructor sets the original `owner` of the contract to the sender\n   * account.\n   */\n  function Ownable() public {\n    owner = msg.sender;\n  }\n\n\n  /**\n   * @dev Throws if called by any account other than the owner.\n   */\n  modifier onlyOwner() {\n    require(msg.sender == owner);\n    _;\n  }\n\n\n  /**\n   * @dev Allows the current owner to transfer control of the contract to a newOwner.\n   * @param newOwner The address to transfer ownership to.\n   */\n  function transferOwnership(address newOwner) public onlyOwner {\n    require(newOwner != address(0));\n    OwnershipTransferred(owner, newOwner);\n    owner = newOwner;\n  }\n\n}\n",
    "zeppelin-solidity/token/BasicToken.sol": "pragma solidity ^0.4.18;\n\n\nimport './ERC20Basic.sol';\nimport '../math/SafeMath.sol';\n\n\n/**\n * @title Basic token\n * @dev Basic version of StandardToken, with no allowances.\n */\ncontract BasicToken is ERC20Basic {\n  using SafeMath for uint256;\n\n  mapping(address => uint256) balances;\n\n  /**\n  * @dev transfer token for a specified address\n  * @param _to The address to transfer to.\n  * @param _value The amount to be transferred.\n  */\n  function transfer(address _to, uint256 _value) public returns (bool) {\n    require(_to != address(0));\n    require(_value <= balances[msg.sender]);\n\n    // SafeMath.sub will throw if there is not enough balance.\n    balances[msg.sender] = balances[msg.sender].sub(_value);\n    balances[_to] = balances[_to].add(_value);\n    Transfer(msg.sender, _to, _value);\n    return true;\n  }\n\n  /**\n  * @dev Gets the balance of the specified address.\n  * @param _owner The address to query the the balance of.\n  * @return An uint256 representing the amount owned by the passed address.\n  */\n  function balanceOf(address _owner) public view returns (uint256 balance) {\n    return balances[_owner];\n  }\n\n}\n",

    "zeppelin-solidity/token/StandardToken.sol": "pragma solidity ^0.4.18;\n\n\nimport './BasicToken.sol';\nimport './ERC20.sol';\n\n\n/**\n * @title Standard ERC20 token\n *\n * @dev Implementation of the basic standard token.\n * @dev https://github.com/ethereum/EIPs/issues/20\n * @dev Based on code by FirstBlood: https://github.com/Firstbloodio/token/blob/master/smart_contract/FirstBloodToken.sol\n */\ncontract StandardToken is ERC20, BasicToken {\n\n  mapping (address => mapping (address => uint256)) internal allowed;\n\n\n  /**\n   * @dev Transfer tokens from one address to another\n   * @param _from address The address which you want to send tokens from\n   * @param _to address The address which you want to transfer to\n   * @param _value uint256 the amount of tokens to be transferred\n   */\n  function transferFrom(address _from, address _to, uint256 _value) public returns (bool) {\n    require(_to != address(0));\n    require(_value <= balances[_from]);\n    require(_value <= allowed[_from][msg.sender]);\n\n    balances[_from] = balances[_from].sub(_value);\n    balances[_to] = balances[_to].add(_value);\n    allowed[_from][msg.sender] = allowed[_from][msg.sender].sub(_value);\n    Transfer(_from, _to, _value);\n    return true;\n  }\n\n  /**\n   * @dev Approve the passed address to spend the specified amount of tokens on behalf of msg.sender.\n   *\n   * Beware that changing an allowance with this method brings the risk that someone may use both the old\n   * and the new allowance by unfortunate transaction ordering. One possible solution to mitigate this\n   * race condition is to first reduce the spender's allowance to 0 and set the desired value afterwards:\n   * https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729\n   * @param _spender The address which will spend the funds.\n   * @param _value The amount of tokens to be spent.\n   */\n  function approve(address _spender, uint256 _value) public returns (bool) {\n    allowed[msg.sender][_spender] = _value;\n    Approval(msg.sender, _spender, _value);\n    return true;\n  }\n\n  /**\n   * @dev Function to check the amount of tokens that an owner allowed to a spender.\n   * @param _owner address The address which owns the funds.\n   * @param _spender address The address which will spend the funds.\n   * @return A uint256 specifying the amount of tokens still available for the spender.\n   */\n  function allowance(address _owner, address _spender) public view returns (uint256) {\n    return allowed[_owner][_spender];\n  }\n\n  /**\n   * approve should be called when allowed[_spender] == 0. To increment\n   * allowed value is better to use this function to avoid 2 calls (and wait until\n   * the first transaction is mined)\n   * From MonolithDAO Token.sol\n   */\n  function increaseApproval(address _spender, uint _addedValue) public returns (bool) {\n    allowed[msg.sender][_spender] = allowed[msg.sender][_spender].add(_addedValue);\n    Approval(msg.sender, _spender, allowed[msg.sender][_spender]);\n    return true;\n  }\n\n  function decreaseApproval(address _spender, uint _subtractedValue) public returns (bool) {\n    uint oldValue = allowed[msg.sender][_spender];\n    if (_subtractedValue > oldValue) {\n      allowed[msg.sender][_spender] = 0;\n    } else {\n      allowed[msg.sender][_spender] = oldValue.sub(_subtractedValue);\n    }\n    Approval(msg.sender, _spender, allowed[msg.sender][_spender]);\n    return true;\n  }\n\n}\n"
